import React,{useState} from 'react'
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Explore from '../../Pages/Explore'
import Following from '../../Pages/Following'
import MyItems from '../../Pages/MyItems'
import FormControl from 'react-bootstrap/FormControl';
import CryptoIcon from '../../../src/assets/crypto-ket.svg'
import SearchIcon from '../../../src/assets/search.svg'
import './header.css';

import {
    BrowserRouter as Router,
    Routes,
    Route,
    Link
  } from "react-router-dom";



const BasicExample=()=> {
  const [value,setValue]=useState('')
  return (
    <Router>
      <Navbar bg="dark" variant="dark">
        <Container>
        <img src={CryptoIcon} alt="React Logo" />
        <div className='wrapper'>
        <FormControl
    type="text"
    value={this.state.value}
    placeholder="Your email"
    onChange={this.handleChange}
    className="login-input"
/>
<FormControl.Feedback>
    <span style={{ top: '5px' }}>
        <FontAwesome name="check" spin key="icon" />
    </span>
</FormControl.Feedback>
        </div>
          <Nav  defaultActiveKey="/" className="me-auto">
            <Nav.Link as={Link} to={'/'}>Explore</Nav.Link>
            <Nav.Link as={Link} to={'/MyItems'}>MyItems</Nav.Link>
            <Nav.Link as={Link} to={'/Following'}>Following</Nav.Link>
          </Nav>
        </Container>
      </Navbar>
      <div>
      <Routes>
    <Route path="/" element={<Explore/>} />
    <Route path="MyItems" element={<MyItems/>} />
    <Route path="Following" element={<Following/>} />
  </Routes>
      </div>
    </Router>
  );
}

export default BasicExample;
